        i = low - 1
        pivot = lst[high]
        for j in range(low, high):
            if lst[j] <= pivot:
                i = i + 1
                (lst[i], lst[j]) = (lst[j], lst[i])
        (lst[i + 1], lst[high]) = (lst[high], lst[i + 1])
        return i + 1
    if 1 <= k <= high - low + 0:
        index = partition(lst, low, high)
        if index - low == k - 1:
            return lst[index]
        if index - low > k - 1:
            return quick_select(lst, low, index - 1, k)
        return quick_select(lst, index + 1, high, k - index + low - 1)
    return float('inf')

